            })();

            var fast_marker_cluster_b61a6abbae85e989eaf7c7d238bf916e = (function(){
                
                var callback = function (row) {
                    var icon = L.AwesomeMarkers.icon();
                    var marker = L.marker(new L.LatLng(row[0], row[1]));
                    marker.setIcon(icon);
                    return marker;
                };

                var data = [];
                var cluster = L.markerClusterGroup({"disableClusteringAtZoom": 12, "showCoverageOnHover": true});

                for (var i = 0; i < data.length; i++) {
                    var row = data[i];
                    var marker = callback(row);
                    marker.addTo(cluster);
                }

                cluster.addTo(map_a43b93202ccedc176222cb67e79815ca);
                return cluster;
            })();
